import React,{Component} from "react";
import './product_list';

export default class RecordList extends Component {
    render() {
        return (
            <tr>
                <td>
                    {this.props.sku}
                </td>
                <td>
                     {this.props.name}
                </td>
                <td>
                     {this.props.obj.price}
                </td>
                <td>
                     {this.props.obj.attribute}
                </td>

            </tr>
        );
    }
}
